member.remarks:
Instances are semi-immutable, not allowing changes if "locked".
This allows a master list in Semio.ClinWeb.Common.ServiceModel.SyndicationLinkRelations
without the risk of an accessor of the meta info to change the meta info.


        public static SyndicationLinkRelationInfo Screenshot = new SyndicationLinkRelationInfo
            {
                RelationshipType = "screenshot",
                UriFormat = "{ItemId}?format=image",
                TitleFormat = "{ItemTitle} - Screenshot",
                StructureLocked = true,
            };
